import React, { Component } from 'react';
import ReactCardCarousel from 'react-card-carousel';

class Content01 extends Component {

  static get CARD_STYLE() {
    return {
      height: '200px',
      width: '200px',
      paddingTop: '80px',
      textAlign: 'center',
      background: '#52C0F5',
      color: '#FFF',
      fontSize: '12px',
      textTransform: 'uppercase',
      borderRadius: '10px',
    };
  }

  render() {
    return (
      <ReactCardCarousel autoplay={ true } autoplay_speed={ 2500 }>
        <div style={ Content01.CARD_STYLE }>
          First Card
        </div>
        <div style={ Content01.CARD_STYLE }>
          Second Card
        </div>
        <div style={ Content01.CARD_STYLE }>
          Third Card
        </div>
        <div style={ Content01.CARD_STYLE }>
          Fourth Card
        </div>
        <div style={ Content01.CARD_STYLE }>
          Fifth Card
        </div>
      </ReactCardCarousel>
    );
  }
}

export default Content01;
